const names = ["John", "Paul", "Ringo", "George"];

function App() {
  return (
    <div>
      {names
        .filter((name) => name.includes("J"))
        .map((filteredName) => (
          <li>{filteredName}</li>
        ))}
    </div>
  );
}

// Import React as usual.
import React from "react";
import ReactDOM from "react-dom";

class Car extends React.Component {
  render() {
    return <h2>Hi, I am a Car!</h2>;
  }
}

// Use an export statement if you want to reuse your component in a differnt
// file. Note also that there can only be one default export per file.
export default Car;

